script: |
  super -f text -I q1960.spq | sort > q1960.out

inputs:
  - name: q1960.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 * - - col2 + + 3 IN ( 30 * - col0 + + 51 / + col1 );
  - name: tab1

outputs:
  - name: q1960.out
    data: |
      51	14	96
      85	5	59
      91	47	68
